import { Button } from '@material-ui/core'

let style = {
    textAlign: 'center',
    width: '100%'
}

const emergencySection = () => (
    <div style={style}>
        <Button onClick={()=>{console.log("hello")}} style={{width: '100%', height: '100%'}}/>
    </div>
)

export default emergencySection
